import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const DiagnosticContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  background: rgba(0, 0, 0, 0.8);
  color: white;
  padding: 10px;
  font-size: 12px;
  z-index: 9999;
  max-height: 200px;
  overflow-y: auto;
`;

const ToggleButton = styled.button`
  position: fixed;
  bottom: 20px;
  right: 20px;
  background: #ff6b8a;
  color: white;
  border: none;
  border-radius: 50%;
  width: 50px;
  height: 50px;
  font-size: 18px;
  cursor: pointer;
  z-index: 10000;
`;

function PWADiagnostic() {
  // Auto-ouverture si pas de token ou si ?diag=1 dans l'URL
  const shouldAutoOpen = !localStorage.getItem('us_token') || window.location.search.includes('diag=1');
  const [showDiagnostic, setShowDiagnostic] = useState(shouldAutoOpen);
  const [diagnosticInfo, setDiagnosticInfo] = useState([]);
  const [version] = useState(() => {
    // Version simple bas√©e sur date build chargee
    return 'v' + new Date().toISOString().replace(/[-:T]/g, '').slice(0, 12);
  });

  useEffect(() => {
    const info = [];
    
    // Informations de base
    info.push(`üì± User Agent: ${navigator.userAgent.substring(0, 100)}...`);
    info.push(`üåê URL: ${window.location.href}`);
    info.push(`üì¶ Local Storage Items: ${localStorage.length}`);
    
  // V√©rifier le token
    const token = localStorage.getItem('us_token');
    const userData = localStorage.getItem('us_user');
    info.push(`üîë Token pr√©sent: ${!!token}`);
    info.push(`üë§ User data pr√©sent: ${!!userData}`);
    
    if (token) {
      try {
        const payload = JSON.parse(atob(token.split('.')[1]));
        const isValid = payload.exp * 1000 > Date.now();
        info.push(`‚úÖ Token valide: ${isValid}`);
        info.push(`‚è∞ Token expire: ${new Date(payload.exp * 1000).toLocaleString()}`);
      } catch (error) {
        info.push(`‚ùå Erreur token: ${error.message}`);
      }
    }
    
    // Service Worker
    if ('serviceWorker' in navigator) {
      navigator.serviceWorker.getRegistrations().then(registrations => {
        info.push(`üîß Service Workers: ${registrations.length}`);
        registrations.forEach((registration, index) => {
          info.push(`SW${index}: ${registration.active?.state || 'N/A'}`);
        });
        setDiagnosticInfo([...info]);
      });
    } else {
      info.push(`‚ùå Service Worker non support√©`);
    }
    
    // PWA
    info.push(`üì≤ PWA mode: ${window.matchMedia('(display-mode: standalone)').matches ? 'Standalone' : 'Browser'}`);
    
    // Network
    info.push(`üì∂ Online: ${navigator.onLine}`);
    
    // Ajouter info sur dimensions viewport
    info.push(`üìê Viewport: ${window.innerWidth}x${window.innerHeight}`);
    info.push(`üïí Charg√© √†: ${new Date().toLocaleTimeString()}`);
    info.push(`üè∑Ô∏è Version: ${version}`);

    setDiagnosticInfo(info);
  }, []);

  const clearStorage = () => {
    localStorage.clear();
    sessionStorage.clear();
    window.location.reload();
  };

  const reinstallSW = async () => {
    if ('serviceWorker' in navigator) {
      const registrations = await navigator.serviceWorker.getRegistrations();
      for (let registration of registrations) {
        await registration.unregister();
      }
      window.location.reload();
    }
  };

  if (!showDiagnostic) {
    return (
      <ToggleButton onClick={() => setShowDiagnostic(true)}>
        üîç
      </ToggleButton>
    );
  }

  return (
    <>
      <DiagnosticContainer>
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '10px' }}>
          <strong>üîç PWA Diagnostic ({version})</strong>
          <button onClick={() => setShowDiagnostic(false)} style={{ background: 'none', border: 'none', color: 'white', cursor: 'pointer' }}>‚ùå</button>
        </div>
        
        {diagnosticInfo.map((info, index) => (
          <div key={index} style={{ marginBottom: '5px' }}>
            {info}
          </div>
        ))}
        
        <div style={{ marginTop: '10px', display: 'flex', gap: '10px' }}>
          <button onClick={clearStorage} style={{ background: '#ff6b8a', color: 'white', border: 'none', padding: '5px 10px', borderRadius: '5px', fontSize: '10px' }}>
            üóëÔ∏è Clear Storage
          </button>
          <button onClick={reinstallSW} style={{ background: '#4ecdc4', color: 'white', border: 'none', padding: '5px 10px', borderRadius: '5px', fontSize: '10px' }}>
            üîÑ Reinstall SW
          </button>
          <button onClick={() => window.location.reload()} style={{ background: '#333', color: 'white', border: 'none', padding: '5px 10px', borderRadius: '5px', fontSize: '10px' }}>
            üîÑ Reload
          </button>
        </div>
      </DiagnosticContainer>
      
      <ToggleButton onClick={() => setShowDiagnostic(false)}>
        ‚ùå
      </ToggleButton>
    </>
  );
}

export default PWADiagnostic;
